import Header from './components/header';

import { BrowserRouter,Route, Switch, Redirect } from 'react-router-dom';
const Post = React.lazy(() => import('./features/post/index'));
function App() {
  return (
    <BrowserRouter>
      <div>
        <Header />
        <Switch>
          <Route path='/post'>
            <Post/>
          </Route>
          <Redirect from='/' to='post'/>
        </Switch>
      </div>
    </BrowserRouter>

  );
}

export default App;
